function SideBar({ repos, onCloneRepo, onRepoSelect }) {
    return (
        <div className="sidebar">
            <h3>Repositories</h3>
            <ul>
                {repos.map((repo, index) => (
                    <li key={index} onClick={() => onRepoSelect(repo)}>
                        {repo}
                    </li>
                ))}
            </ul>
            <button className="clone-repo" onClick={onCloneRepo}>
                Clone Repo
            </button>
        </div>
    );
}

export default SideBar;
